// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;

import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

contract RuleContract is Ownable {
    using Counters for Counters.Counter;
    
    /**
     * @dev Structure of Rules
     * @notice Feature_V2 
     */
    struct Rule {
        bytes8 version;        
        uint16 serviceId;
        bytes8 codeAlert;
        bytes8 valueAlert;
        bool isActive;
        address legislatorAddress;
        string description;   

        Counters.Counter alertIdCounter;         
    }

    modifier isContractActive() {
        require(isActive, "Contract off line");
        _;
    }

    modifier isRulesActive(uint _ruleId) {
        require(_ruleId < _ruleIdCounter.current(), "Rules not exist"); 
        require(_rules[_ruleId].isActive, "Rules off line"); 
        _;
    }  

    modifier onlyLegislator() {
        require (customerAddress == msg.sender || owner() ==  msg.sender || _legislators[msg.sender] == true, "Access denied");
        _;
    }

    modifier onlyCustomer() {
        require (customerAddress == msg.sender || owner() ==  msg.sender, "Access denied");
        _;
    }    

    event RulesUpdate(uint _serviceId, uint _ruleId, string _message, address _author); 
    event AlertReceive(uint _serviceId, uint _ruleId, bytes32 _alert, address _author); 
    event ContractUpdate(string _message, address _author);  

    address public serviceContactAddress;    

    bytes8 public version;
    uint32 public clientId;
    uint64 public prevContractDate;
    uint64 public nextContractDate;
    address public customerAddress;
    address public prevContract;
    address public nextContract;
    bool public isActive;

    constructor (bytes8 _version, uint32 _clientId, address _customerAddress, address _prevContract, uint64 _prevContractDate) {
        version = _version;
        clientId = _clientId;
        prevContractDate = _prevContractDate;
        nextContractDate = 0;
        customerAddress = _customerAddress;
        prevContract = _prevContract;
        nextContract = address(0);
        isActive = true;
    }

    Rule[] public _rules;
    mapping(uint => bytes32[]) public _alerts; 
    mapping(address => bool) public _legislators;

    Counters.Counter public _ruleIdCounter;
 
    /**
     * @dev toggle a Contract activation or deactivation
     */
    function toggleContract()
        onlyOwner() external {
            emit ContractUpdate("Contract on/off", msg.sender);
            isActive = !isActive;
    }  

    /**
     * @dev toggle a Contract activation or deactivation
     */
    function setServiceContactAddress(address _serviceContactAddress)
        onlyOwner() external {
            serviceContactAddress = _serviceContactAddress;
    }      

    /**
     * @dev add a fondation's alert config
     * @param _serviceId index of service 
     * @param _version service's version
     * @param _description alert config description 
     * @param _codeAlert alert's code
     * @param _valueAlert alert's value
     */
    function addRule(
        bytes8 _version,   
        uint16 _serviceId,        
        string memory _description,  
        bytes8 _codeAlert,
        bytes8 _valueAlert)
        isContractActive() onlyLegislator() external {

        address _legislatorAddress = msg.sender;

        Counters.Counter memory alertIdCounter;

        _rules.push(Rule(
            _version,  
            _serviceId, 
            _codeAlert,
            _valueAlert,   
            true,                           
            _legislatorAddress,
            _description, 
            alertIdCounter
        ));

        _ruleIdCounter.increment();
    }

    /**
     * @dev get all alert configs
     */
    function getAllRules() 
        external view 
        returns(Rule[] memory){
              
        return (_rules);
    }

    /**
     * @dev toggle an alert config
     * @param _ruleId index of the alert config
     */
    function toggleRule(uint _ruleId) 
        external {

        require ((msg.sender == _rules[_ruleId].legislatorAddress) || (msg.sender == owner()));

        emit RulesUpdate(_rules[_ruleId].serviceId, _ruleId, "Alert on/off", msg.sender);

        _rules[_ruleId].isActive = !_rules[_ruleId].isActive;
    }       

    // ALERTS PART

    /**
     * @dev add an alert
     * @param _serviceId index of service 
     * @param _alertBody alert's body
     */    
    function addAlert(
        uint _serviceId,
        uint _ruleId,
        bytes32 _alertBody) 
        external {         

        // TODO CHECK BRIDGE ORIGIN

        _alerts[_ruleId].push(_alertBody);
        _rules[_ruleId].alertIdCounter.increment();

        emit AlertReceive(_serviceId, _ruleId, _alertBody, msg.sender);
    }

    /**
     * @dev get all alerts of a specific alerteConfig
     * @param _alertConfigId index of alerteConfig 
     */  
    function getAlerts(
        uint _alertConfigId) 
        external view 
        returns(bytes32[] memory){
            
        return (_alerts[_alertConfigId]);        
    }


}

